import React, { useState } from 'react'


export default function Hooks() {
    const [count, incCount] = useState(10)


    const Increment = () => {

  
        incCount(count + 1);


    }
    return (
        <div>
            <h1>Count={count}</h1>
            <button onClick={Increment}>Click me</button>
        </div>
    )
}
